import FirebaseAuth from "../components/FirebaseAuth";

const Auth = () => {
  const { user, logout } = useUser();

  if (user) {
    return (
      <>
        <p>Hi there!</p>
        <p>
          You are signed in.{" "}
          <Link href={"/profile"}>
            <a>Go to your profile</a>
          </Link>
        </p>
      </>
    );
  }
  return (
    <div>
      <div>
        <FirebaseAuth />
      </div>
    </div>
  );
};

Auth.propTypes = {};

export default Auth;
